import React from 'react';
import '../styles/ProyectosRecientes.css';

const ProyectosRecientes = () => {
  const proyectos = [
    { nombre: "Sistema de Gestión", color: "#ffd54f" },
    { nombre: "Aplicación Móvil", color: "#81c784" },
    { nombre: "E-Commerce", color: "#4fc3f7" },
    { nombre: "Portal Educativo", color: "#ff8a65" },
    { nombre: "Dashboard Administrativo", color: "#ba68c8" },
    { nombre: "Asistente Virtual", color: "#f06292" },
  ];

  return (
    <div className="proyectos-container">
      {/* Zona de IA */}
      <aside className="sidebar">
        <h2>Proyectos Recientes</h2>
        <div className="ia-section">
          <div className="ia-card">
            <img src="ruta_a_imagen_tiburon" alt="IA" />
            <p>Inteligencia Artificial (IA)</p>
          </div>
        </div>
      </aside>

      {/* Zona de proyectos */}
      <main className="proyectos-main">
        <div className="proyectos-grid">
          {proyectos.map((proyecto, index) => (
            <div
              key={index}
              className="proyecto-card"
              style={{ backgroundColor: proyecto.color }}
            >
              <div className="proyecto-content">
                <h3>{proyecto.nombre}</h3>
              </div>
            </div>
          ))}
        </div>
      </main>
    </div>
  );
};

export default ProyectosRecientes;
